import React from "react";

const ProjectItem = ({ project }) => {
  return (
    <tr>
      <td>{project.id}</td>
      <td>{project.title}</td>
      <td>{project.link}</td>
      <td>{project.usersWorked.join(", ")}</td>
    </tr>
  );
};
const ProjectList = ({ projects }) => {
  return (
    <table className="table table-bordered">
      <thead>
        <tr>
          <th>ID</th>
          <th>Title</th>
          <th>Link</th>
          <th>UsersWorked</th>
        </tr>
      </thead>
      <tbody>
        {projects.map((project) => (
          <ProjectItem project={project} key={project.id.toString()} />
        ))}
      </tbody>
    </table>
  );
};

const ProjectListFilterId = ({ projects }) => {
  let { id } = useParams();
  let filtered_items = projects.filter((item) => item.id == id);
  return (
    <table className="table table-bordered">
      <thead>
        <tr>
          <th>ID</th>
          <th>Title</th>
          <th>Link</th>
          <th>UsersWorked</th>
        </tr>
      </thead>
      <tbody>
        {projects.map((project) => (
          <ProjectItem filtered_items={project} key={project.id.toString()} />
        ))}
      </tbody>
    </table>
  );
};
export default ProjectList;
